import{_ as e,c as t,o as a,d as i}from"./app.676fede4.js";const m=JSON.parse('{"title":"\uB178\uC158 Notion api\uB85C \uBE14\uB85C\uADF8 \uC790\uCCB4 \uAC1C\uBC1C\uD558\uAE30 - Intro","description":"","frontmatter":{},"headers":[{"level":3,"title":"\uB9CC\uB4E4\uC5C8\uB2E4. \uBE14\uB85C\uADF8. Vue + Notion api \uB85C \u{1F60E}","slug":"\uB9CC\uB4E4\uC5C8\uB2E4-\uBE14\uB85C\uADF8-vue-notion-api-\uB85C-\u{1F60E}","link":"#\uB9CC\uB4E4\uC5C8\uB2E4-\uBE14\uB85C\uADF8-vue-notion-api-\uB85C-\u{1F60E}","children":[]},{"level":3,"title":"\uADFC\uB370 \uC880 \uB290\uB9AC\uB2EC\uAE4C \u{1F928}","slug":"\uADFC\uB370-\uC880-\uB290\uB9AC\uB2EC\uAE4C-\u{1F928}","link":"#\uADFC\uB370-\uC880-\uB290\uB9AC\uB2EC\uAE4C-\u{1F928}","children":[]},{"level":3,"title":"\uADF8\uB9AC\uACE0 \uCE5C\uC808\uD558\uC9C0 \uC54A\uC740 Notion api document\u2026\u2026.","slug":"\uADF8\uB9AC\uACE0-\uCE5C\uC808\uD558\uC9C0-\uC54A\uC740-notion-api-document\u2026\u2026","link":"#\uADF8\uB9AC\uACE0-\uCE5C\uC808\uD558\uC9C0-\uC54A\uC740-notion-api-document\u2026\u2026","children":[]},{"level":3,"title":"\uADF8\uB798\uB3C4 \uC4F8\uB9CC\uD558\uB2E4","slug":"\uADF8\uB798\uB3C4-\uC4F8\uB9CC\uD558\uB2E4","link":"#\uADF8\uB798\uB3C4-\uC4F8\uB9CC\uD558\uB2E4","children":[]}],"relativePath":"study/0-notionapi.md"}'),n={name:"study/0-notionapi.md"},o=i('<h1 id="\uB178\uC158-notion-api\uB85C-\uBE14\uB85C\uADF8-\uC790\uCCB4-\uAC1C\uBC1C\uD558\uAE30-intro" tabindex="-1">\uB178\uC158 Notion api\uB85C \uBE14\uB85C\uADF8 \uC790\uCCB4 \uAC1C\uBC1C\uD558\uAE30 - Intro <a class="header-anchor" href="#\uB178\uC158-notion-api\uB85C-\uBE14\uB85C\uADF8-\uC790\uCCB4-\uAC1C\uBC1C\uD558\uAE30-intro" aria-hidden="true">#</a></h1><p>\uC5BC\uB9C8\uC804\uC5D0 \uB2C8\uCF54\uC324\uC758 \uC601\uC0C1\uC744 \uBCF4\uB2E4\uAC00 \uAF42\uD78C\uAC8C \uC788\uC5C8\uC73C\uB2C8, \uBC14\uB85C \uC694 \uC601\uC0C1\uC774\uB2E4.</p><p><a href="https://youtu.be/XCAwSBdeejU" target="_blank" rel="noreferrer">https://youtu.be/XCAwSBdeejU</a></p><p>\uC601\uC0C1\uC5D0\uC11C\uB294 Notion api\uB97C \uC18C\uAC1C\uD558\uACE0 \uC788\uB2E4. Notion api\uB780, \uB178\uC158\uC5D0 \uC791\uC131\uB41C Database\uB4E4\uC744 api\uB85C \uBD88\uB7EC\uC62C \uC218 \uC788\uB294 \uAE30\uB2A5\uC774\uB2E4. \uB178\uC158\uC774\uB77C\uB294 \uC571\uC744 \uC5C4\uCCAD \uC720\uC6A9\uD558\uAC8C \uC798 \uC4F0\uACE0 \uC788\uB294 \uB098\uB85C\uC11C\uB294 \uC5C4\uCCAD \uD639\uD560\uB9CC\uD55C \uB0B4\uC6A9\uC774\uC5C8\uB2E4.</p><p><a href="https://developers.notion.com/" target="_blank" rel="noreferrer">\uB178\uC158 API \uACF5\uC2DD \uD648\uD398\uC774\uC9C0 &gt;</a></p><p>\uD3C9\uC18C\uC5D0 \uBE14\uB85C\uADF8\uB97C \uB9CC\uB4E4\uACE0 \uC2F6\uC5C8\uB294\uB370 \uB9C8\uB545\uD55C CMS\uD234\uC744 \uCC3E\uAE30\uAC00 \uC5B4\uB824\uC6E0\uB2E4. Strapi\uB97C \uC0AC\uC6A9\uD560\uAE4C\uB3C4 \uD588\uC9C0\uB9CC \uB9E4\uB2EC \uC77C\uC815 \uAE08\uC561\uC744 \uC9C0\uBD88\uD574\uC57C \uD558\uB294 \uAC8C \uC2EB\uC5C8\uACE0, \uB354 \uAC04\uD3B8\uD558\uAC8C \uCEE8\uD150\uCE20\uB97C \uAD00\uB9AC\uD560 \uC218 \uC788\uB294 \uD234\uC774 \uC5C6\uC744\uAE4C \uCC3E\uC544\uD5E4\uB9F8\uB2E4. \uADF8\uB7EC\uB2E4\uAC00 notion api\uB97C \uC0B4\uD3B4\uBCF4\uB2C8, \uC9C0\uAE08 \uAC1C\uC778\uC801\uC73C\uB85C \uC0AC\uC6A9\uD558\uACE0 \uC788\uB294 \uB178\uC158\uC744 CMS(Content Management System) \uD234\uB85C \uC0AC\uC6A9\uD560 \uC218 \uC788\uC744 \uAC83 \uAC19\uC558\uB2E4. \uC624\uC624\u2026. \uB0B4\uAC00 \uB178\uC158 Notion\uC5D0 \uC791\uC131\uD55C \uAE00\uB4E4\uC744 DB\uCC98\uB7FC api\uB85C \uBD88\uB7EC\uC640\uC11C \uC0AC\uC6A9\uD560 \uC218 \uC788\uB2E4\uACE0..? \uC774\uB7F0 \uAE30\uB2A5\uC774 \uC9C4\uC791\uC5D0 \uC65C \uC5C6\uC5C8\uC744\uAE4C \uC2F6\uC744 \uC815\uB3C4\uB85C \uC2E0\uBC15\uD55C \uB108\uB08C!!</p><h3 id="\uB9CC\uB4E4\uC5C8\uB2E4-\uBE14\uB85C\uADF8-vue-notion-api-\uB85C-\u{1F60E}" tabindex="-1">\uB9CC\uB4E4\uC5C8\uB2E4. \uBE14\uB85C\uADF8. Vue + Notion api \uB85C \u{1F60E} <a class="header-anchor" href="#\uB9CC\uB4E4\uC5C8\uB2E4-\uBE14\uB85C\uADF8-vue-notion-api-\uB85C-\u{1F60E}" aria-hidden="true">#</a></h3><p>\uADF8\uB798\uC11C \uB9CC\uB4E4\uC5B4\uBD24\uB2E4. \uD638\uAE30\uC2EC\uC740 \uC0AC\uB78C\uC744 \uC6C0\uC9C1\uC778\uB2E4(..) \uADF8 \uACB0\uACFC \uC131\uACF5\uD588\uB2E4. \uD504\uB85C\uC81D\uD2B8\uB294 Vue3\uB85C \uBE4C\uB4DC\uD558\uACE0 \uCEE8\uD150\uCE20\uB294 notion\uC5D0 \uC62C\uB824\uC11C api\uB85C \uBC1B\uACE0, \uD638\uC2A4\uD305\uC740 github page\uB85C \uAC04\uB2E8\uD558\uAC8C \uC62C\uB838\uB2E4. \uC5B4\uB5BB\uAC8C \uD588\uB294\uC9C0 \uC2A4\uD15D \uBC14\uC774 \uC2A4\uD15D\uC73C\uB85C \uBE14\uB85C\uADF8\uC5D0 \uD558\uB098\uC529 \uC62C\uB824\uBCFC \uC0DD\uAC01\uC774\uB2E4.</p><h3 id="\uADFC\uB370-\uC880-\uB290\uB9AC\uB2EC\uAE4C-\u{1F928}" tabindex="-1">\uADFC\uB370 \uC880 \uB290\uB9AC\uB2EC\uAE4C \u{1F928} <a class="header-anchor" href="#\uADFC\uB370-\uC880-\uB290\uB9AC\uB2EC\uAE4C-\u{1F928}" aria-hidden="true">#</a></h3><p>\uACB0\uB860\uBD80\uD130 \uC774\uC57C\uAE30\uD558\uC790\uBA74, \uC870\uAE08 \uBB34\uAC81\uB2E4. \uBE14\uB85C\uADF8 \uBA54\uB274\uB97C \uB4E4\uC5B4\uAC00\uBA74 \uC54C \uC218 \uC788\uB4EF\uC774 \uB85C\uB529\uBC14\uB97C \uB9CC\uB4E4 \uC218 \uBC16\uC5D0 \uC5C6\uC744 \uC815\uB3C4\uC758 \uB290\uB9BC\u2026.. \uB290\uB9B0 \uC18D\uB3C4\uC758 \uC6D0\uC778\uC774 serverless hosting\uC744 \uD55C Cloudflare\uC5D0\uC11C \uBC1C\uC0DD\uD558\uB294\uAC74\uC9C0 notion api\uAC00 \uB290\uB9B0\uAC74\uC9C0 \uC81C\uB300\uB85C \uD30C\uC545\uC774 \uD544\uC694\uD558\uACA0\uC9C0\uB9CC \uACB0\uB860\uC801\uC73C\uB85C\uB294 \uC7A5\uB2E8\uC810\uC774 \uC788\uB2E4\uACE0 \uD558\uACA0\uB2E4. \uCEE8\uD150\uCE20\uB97C \uB178\uC158\uC73C\uB85C \uAD00\uB9AC\uD560 \uC218 \uC788\uB2E4\uB294 \uD070 \uC7A5\uC810! \uBC18\uBA74 \uC57D\uAC04\uC740 \uBB34\uAC70\uC6B4 \uB108\uB08C\u2026</p><h3 id="\uADF8\uB9AC\uACE0-\uCE5C\uC808\uD558\uC9C0-\uC54A\uC740-notion-api-document\u2026\u2026" tabindex="-1">\uADF8\uB9AC\uACE0 \uCE5C\uC808\uD558\uC9C0 \uC54A\uC740 Notion api document\u2026\u2026. <a class="header-anchor" href="#\uADF8\uB9AC\uACE0-\uCE5C\uC808\uD558\uC9C0-\uC54A\uC740-notion-api-document\u2026\u2026" aria-hidden="true">#</a></h3><p>\uC74C, \uC544\uB2C8\uB2E4 \uB2E4\uD050\uBA3C\uD2B8 \uC790\uCCB4\uB294 \uCE5C\uC808\uD558\uB2E4. \uADFC\uB370 \uBC1B\uC544\uC624\uB294 data\uB4E4\uC774 \uC880 \uBD88\uCE5C\uC808(?)\uD558\uB2E4. Database Id\uB85C data\uB97C \uBC1B\uC544\uC654\uC744 \uB54C \uB0B4\uAC00 \uC6D0\uD558\uB294 \uAC74 \uAC01 page\uB4E4\uC758 \uBAA9\uB85D\uACFC \uD0C0\uC774\uD2C0\uC744 \uC54C\uACE0 \uC2F6\uC740\uB370 db\uB97C retrieve \uD558\uB294 api\uB85C \uBC1B\uC544\uC624\uB294 \uB370\uC774\uD130\uC5D0\uB294 \uADF8\uB7F0\uAC8C \uC5C6\uC5C8\uB2E4. (\uBC84\uC804 \uB2E4\uC6B4\uADF8\uB808\uC774\uB4DC\uB85C \uD574\uACB0\uD558\uAE34 \uD588\uC9C0\uB9CC \uB2E4\uD050\uBA3C\uD2B8 \uC5B4\uB514\uC5D0\uB3C4 \uADF8\uB7F0 \uB0B4\uC6A9\uC774 \uC5C6\uC5C8\uB2E4\u2026) \uADF8\uB798\uC11C \uC2DC\uAC04\uC774 \uBC1B\uC544\uC628 \uB370\uC774\uD130\uB97C \uD074\uB77C\uC774\uC5B8\uD2B8\uC5D0\uC11C \uAC00\uACF5\uD574\uC11C \uBCF4\uC5EC\uC918\uC57C \uB418\uB2E4 \uBCF4\uB2C8 \uC2DC\uAC04\uC774 \uB354 \uAC78\uB9AC\uB294 \uAC83\uB3C4 \uC788\uB294 \uAC83 \uAC19\uB2E4.</p><h3 id="\uADF8\uB798\uB3C4-\uC4F8\uB9CC\uD558\uB2E4" tabindex="-1">\uADF8\uB798\uB3C4 \uC4F8\uB9CC\uD558\uB2E4 <a class="header-anchor" href="#\uADF8\uB798\uB3C4-\uC4F8\uB9CC\uD558\uB2E4" aria-hidden="true">#</a></h3><p>\uADF8\uB798\uB3C4 CMS \uD234\uB85C\uC11C\uB294 \uB9E4\uC6B0 \uD6CC\uB96D\uD558\uB2E4. \uB2E4\uB978 CMS \uD234\uB4E4\uC740 \uCEE8\uD150\uCE20\uB97C html \uCF54\uB4DC\uB85C \uBCF4\uB0B4\uC8FC\uB294\uB370, \uADF8\uAC8C \uC885\uC885 \uCEE4\uC2A4\uD130\uB9C8\uC774\uC9D5 \uD558\uAE30\uAC00 \uBD88\uD3B8\uD588\uB358 \uC810\uC774 \uC788\uC5C8\uB2E4. \uBC18\uBA74\uC5D0 \uB178\uC158 api\uB85C page content\uB97C \uBD88\uB7EC\uC624\uBA74, \uBAA8\uB4E0 \uBE14\uB85D(Block)\uB4E4\uC758 JSON \uD30C\uC77C\uB85C \uB370\uC774\uD130\uB97C \uBC1B\uB294\uB2E4. \uAC70\uAE30\uC5D0 \uAC01 BLOCK\uB4E4\uC758 type\uC744 \uC54C \uC218 \uC788\uC5B4\uC11C type\uC5D0 \uB530\uB77C css \uCEE4\uC2A4\uD130\uB9C8\uC774\uC9D5 \uD558\uAE30\uB3C4 \uC26C\uC6E0\uB2E4. \uD558\uC9C0\uB9CC \uD648\uD398\uC774\uC9C0 \uBE4C\uB354\uB85C\uC11C\uB294? 5\uC810 \uB9CC\uC810\uC5D0 3\uC810\uC815\uB3C4. \uC65C\uB0D0\uBA74 \uD398\uC774\uC9C0\uAC00 \uB9CE\uC544\uC9C0\uBA74 \uC5B4\uB5BB\uAC8C \uB420\uC9C0 \uC880 \uB354 \uC9C0\uCF1C\uBD10\uC57C\uACA0\uB2E4.</p>',14),r=[o];function p(d,s,h,l,c,u){return a(),t("div",null,r)}const f=e(n,[["render",p]]);export{m as __pageData,f as default};
